        public string UrlEncoder(string str)
        {
            var key = new ConfigurationBuilder()
                    .AddJsonFile("appsettings.json")
                    .Build().GetSection("DocumentKey").Value!;
            var urle = HttpUtility.UrlEncode(str)
                    .Replace("%20", " ").Replace("%23", "#")
                    .Replace("%2f", "/").Replace("%2F", "/")
                    .Replace("%2b", "+").Replace("%2B", "+")
                    .Replace("%3f", "?").Replace("%3F", "?")
                    .Replace("%3d", "=").Replace("%3D", "=")
                    .Replace("%26", "&");
            return new BaseCoder().DecryptString(cipherText: urle, key: key);
        }
