        public double calculateDate(DateTime startDate, DateTime endDate)
        {
            double calcBusinessDay = 1 + ((endDate - startDate).TotalDays * 5 - (startDate.DayOfWeek - endDate.DayOfWeek) * 2) / 7;
            if (endDate.DayOfWeek == DayOfWeek.Saturday) calcBusinessDay--;
            if (endDate.DayOfWeek == DayOfWeek.Sunday) calcBusinessDay--;

            return calcBusinessDay;
        }

        public static string HashedPassword(string password)
        {
            using var md5 = MD5.Create();
            var Hashed = md5.ComputeHash(ASCIIEncoding.ASCII.GetBytes(password));
            var hashedPass = BitConverter.ToString(Hashed).Replace("-", "").ToLower();
            return hashedPass;
        }


